  public static byte adivinarAreaPrograma(String nombre) {
    int cont[]=new int[9];
    for (String s:nombre.split(" ")) {
      int ind=Arrays.binarySearch(nombresProgramas,s);
      if (ind>=0) cont[areasProgramas[ind][0]-1]+=areasProgramas[ind][1];
    }
    int iMax1=-1,iMax2=-1;
    for (int i=0; i<9; i++) if (iMax1==-1 || cont[i]>cont[iMax1]) iMax1=i;
    for (int i=0; i<9; i++) if (i!=iMax1 && (iMax2==-1 || cont[i]>cont[iMax2])) iMax2=i;
    int v1=cont[iMax1],v2=cont[iMax2];
    if (v1==0 || (v2>0 && 1.0*v1/v2<1.3)) return -1;
    return (byte)(iMax1+1);
  }
